['#include <stdio.h>

int main() {
	static char s[10];
	int n, i, yes1, yes2, yes3, yes4;

	scanf("%d%s", &n, s);
	yes1 = yes2 = yes3 = yes4 = 0;
	for (i = 0; i < n; i++)
		if (s[i] == '1')
			yes1 = yes2 = 1;
		else if (s[i] == '2')
			yes2 = 1;
		else if (s[i] == '3')
			yes2 = yes3 = 1;
		else if (s[i] == '4')
			yes1 = 1;
		else if (s[i] == '6')
			yes3 = 1;
		else if (s[i] == '7')
			yes1 = yes4 = 1;
		else if (s[i] == '9')
			yes3 = yes4 = 1;
		else if (s[i] == '0')
			yes1 = yes3 = yes4 = 1;
	printf(yes1 && yes2 && yes3 && yes4 ? "YES\n" : "NO\n");
	return 0;
}
']

